import React from 'react';
import { View, Text, StyleSheet } from 'react-native';

const Middlepage = () => {
    return (
        <View style={styles.middleContainer}>
            <View>
                <Text style={styles.textStyle}>One Page</Text>
                <Text style={styles.smallText}>Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic versions of Lorem Ipsum.</Text>
            </View>
            
        </View>
    );
}

const styles = StyleSheet.create({
    middleContainer: {
        padding: '10px',
    },
    textStyle: {
        fontSize: 24,
        color: '#000',
        fontWeight: 600,
    },
    smallText: {
        fontSize: 15,
        fontWeight: 400,
        color: "#808080",
        margin:'10px'
    }
})

export default Middlepage;
